import React from 'react';
import '../styles/Jumbotron.css'

function Jumbotron() {
    return (
        <div className="jumbotron" id="Jumbotron">
            <div className="container">
                <div className="row">
                    <div className="col-sm-12 col-lg-12">

                    </div>
                </div>
            </div>
        </div>
    )
}

export default Jumbotron;
